description:
When the folks are away, the boys will play -- even if they're college boys taking care of their parent's place during summer vacation. The boys like throwing crazy parties, too, which is probably why the Koi Pond is dying. Danny's freaking out, too, because those Koi are his dad's prized possession, and if any more die, there's gonna be hell to pay. This is what brings Dr. Jezebel Vessir. The boys found her online. She's a vet, and she specializes in Aquatic animals and fish, and she's going to solve the fish problem. She's going to take care of a lot more, too, including 3 horny college dudes and their overactive hormones. Jezebel is that good.
